%[text] # 1D Poisson Equation
%[text]  $-\\frac{d^2u}{dx^2} = x^4\n\n\n$
%[text] with,  $&dollar&; u(x=0) =0   \\ & u(x=1) = 0 $
%[text] #### 
%%
%[text] ## Exact Solution
%[text] $u(x) =\\frac{x}{30}(1-x^5)$
x_exact = linspace(0,1,400);
u_exact = (x_exact/30).*(1-x_exact.^5);
%%
%[text] ## Numerical Solution (FDM)
%[text] $\\frac{u\_{i+1} +2u\_i -u\_{i-1}}{\\Delta x^2} =x\_i^4$      for i = 2 to i = n-1
%[text] ${u\_{i+1} +2u\_i -u\_{i-1}}{\\Delta x^2} =\\Delta x^2 \[(i-1)\\Delta x\]^4$
%[text] 
function [u] = poisson_1d(n)
L=1; 
dx = L/(n-1);  % distance between grid
x = linspace(0,L,n)';
N = n-2; % interior point 

% A*u = b
A = spdiags([-ones(N,1) 2*ones(N,1) -ones(N,1)],[-1 0 1],N,N);
b = dx^2 * x(2:end-1).^4;
u_in = mldivide(A,b);  % u = A/b

% Boundary Condition
u = zeros(n,1);
u(2:end-1) = u_in;
end
%%
%[text] ## Plot Exact Vs Numerical Solution

figure(1) %[output:4652b206]
plot(x_exact,u_exact,'b',LineWidth= 3) %[output:4652b206]
hold on %[output:4652b206]
n_values = [5 10 20 40 80];
for i = 1:length(n_values)
    n = n_values(i);
    [u] = poisson_1d(n);
    x_num = linspace(0,1,n);
    plot(x_num,u,'r--'); %[output:4652b206]
end
xlabel('x', 'FontSize',15); %[output:4652b206]
ylabel('u','FontSize',15); %[output:4652b206]
title('Exact Vs Numerical Solutions'); %[output:4652b206]
legend('Exact','Numeric'); %[output:4652b206]
grid on %[output:4652b206]
hold off; %[output:4652b206]
%%
%[text] ## RMS VS Delta(x)
%[text] RMS =$\\sqrt{\\frac{1}{n}\\sum\_2^{n-1} {\\left(u\_{\\;\\;} -u\_{\\mathrm{exact}} \\right)}^2 }${"editStyle":"visual"}

delta_x = zeros(length(n_values),1);
rms_values = zeros(length(n_values), 1);
for k = 1:length(n_values)
    n = n_values(k);
    dx = 1/(n-1);
    delta_x(k) = dx;
    u = poisson_1d(n);
    x = linspace(0,1,n)';
    u_exact = (x/30).*(1-x.^5); 
    rms_values(k) = sqrt(mean((u - u_exact).^2));
end
%%
%[text] ## Leading term Error of FD $\\left(\\in \\right)${"editStyle":"visual"}
%[text] $\\in \\;\\;=\\;\\;C\\Delta x^m${"editStyle":"visual"}

dx = delta_x;
E1 =  dx;        % O(dx)
E2 =  dx.^2;     % O(dx^2)
E3 =  dx.^3;     % O(dx^3)

figure(2) %[output:4c907d32]
loglog(dx, rms_values, 'ko-', 'LineWidth', 2) %[output:4c907d32]
hold on %[output:4c907d32]
loglog(dx, E1, 'r^-', 'LineWidth', 1.5) %[output:4c907d32]
loglog(dx,E2, 'bs-', 'LineWidth', 1.5) %[output:4c907d32]
loglog(dx,E3, 'gd-', 'LineWidth', 1.5) %[output:4c907d32]

xlabel('\Delta x') %[output:4c907d32]
ylabel('RMS Error') %[output:4c907d32]
title('RMS and Leading Term Error Graph') %[output:4c907d32]
legend('RMS error VS \Deltax', 'O(\Delta x)', 'O(\Delta x^2)', 'O(\Delta x^3)') %[output:4c907d32]
grid on %[output:4c907d32]
hold off %[output:4c907d32]
%%
%[text] ## To get order of accuracy
%[text] p = mlog($\\Delta x$) + logC

p = polyfit(log(delta_x), log(rms_values), 1); % compute degree 1
order = p(1) % Take Slope Value %[output:7140a43e]
fprintf('Observed order of accuracy = %.3f\n', order); %[output:9c7ce8ba]


